    "suitablePeople": "禁忌:<br/>高/低血压患者，眩晕症者，身体有剧烈疼痛或者手术后恢复阶段不可练习，腕管综合症患者，严重的骨质疏松症患者不可练习；<br/>孕妇，生理期禁倒转、腹部紧张等体式<br/>饭后不宜倒转，防止食物返流，耳部感染及视网膜脱落患者不宜练习倒转动作"
