    "trainingEffect": "灵活髋关节各个方向的活动能力。<br/>促进骨盆区域的气血循环，帮助温养内脏器官。<br/>帮助打开和提升海底轮的能量，使个体的生存具有安全感。<br/>灵活而坚固的髋关节可以减轻背痛，改善双腿的血液循环。另一方面，当我们面对压力或消极的情绪时，如恐惧、悲伤，内疚，往往会积存在我们的骨盆区域和髋部，髋关节的练习有助于释放这些负面的能量。",
