    "classIntroduce": "踏入3岁，你的孩子将变得更加活跃，更具有社交性。此时宝贝的独特个性逐渐展现，并具备了良好的沟通能力。随着幼儿园的团体学习生活的开展，协调能力对于宝贝的生活和学习变得尤为重要。良好的协调及力量，强而有力的自信心与安全感，都将影响孩子初期的学习能力。<br/>COCO-LOCO™针对这个年龄段的孩子，设置了更多有趣好玩的内容，融入更多思维内容，帮助孩子更好更快的掌握空间、色彩、形状、数字等。通过每节课都不一样的游戏，鼓励孩子独立完成挑战，并逐渐掌握更多解决问题的能力。除此之外，孩子基本的学习能力：听从指令、注意力及专注时长成为课程的重点。<br/>Now we are three years old. Your kid becomes more active and more socially. Their personality began to show and they’ve mastered better communication skills.  With the beginning of a group learning life in kindergarten, coordination skill becomes more and more important for their learning and daily life. Coordination and strength, confidence and self-security, all has an important influence in their early study.  COCO-LOCO™ set up more games and exercises in every class, and input more thinking games. Through different fun game, we help your kid to master space, color, shape, numbers and others in a very easy way. We encourage your kid to finish the challenge alone. It would help them to master more skills to solve problems. Beside, the basic learning skills: Follow instructions, attention and concentration level become the key point of this class.",
    "video": "j0893pop1hd",
    "trainingEffect": "经过一段时间的坚持，你会发现宝贝变得自信满满，秩序感也逐步上升。学习变得更加的有趣和快捷，你也将因为孩子的变化变得更加自信。你会发现，你与孩子之间的关系不仅不会因为孩子的独立而逐渐疏远，反而变得更坚实，更有力。<br/><br/>After few classes, you would realized that you baby has more and more confidence, they began to establish inner self-discipline and a sense of order. Study for them becomes more fun and easy. You would also found yourself become more confident with the changing of your kid. You would realized, not only the relationship between you and your baby would not be estranged, but only become stronger and more powerful.",
