    "video": "j0893pop1hd",
    "trainingEffect": "经过一段时间的坚持，你会发现随着宝贝对自身能力的了解越多，就越变得自信满满，秩序感也逐步上升。良好的身体操作能力，将令他们的学习变得更加的有趣和快捷，你也将因为孩子的变化变得更加自信。<br/>After few classes, you would realized that since you kid knows more about himself, he has more and more confidence, they began to establish inner self-discipline and a sense of order. Nice physical abilities would help them to study with more fun and easily. You would also found yourself become more confident with the changing of your kid.",
