    "trainingEffect": "唤醒深层肌肉，锻炼核心肌群，迅速燃脂塑身，特别是最容易堆积脂肪的腹部。伸展脊柱，调整错误姿势。增强肌肉弹性和关节灵活度，提高身体平衡能力，降低运动受伤的几率。普拉提有助于重新伸展绷紧的肌肉，给肌肉做深层按摩，同时练习肌肉耐力，令身体压力平均分布。",
    "suitablePeople": "普拉提没有年龄和性别的限制，适于任何人。特别适合常年坐办公室使肌肉失去力量，缺少运动的上班族。"
