    "video": "",
    "trainingEffect": "此课程一方面聚焦疗愈腿部和膝关节筋键，打开腿部经络，疏通气血；另一方面，则强调发展大小腿部匀称的肌肉线条，让腿型更加优美。尤其适合下肢力量薄弱，稳定性差和运动能力需要提高的人群。",
