    "video": "",
    "trainingEffect": "常见的肩颈问题如上交叉综合症，是由于生活姿态问题导致的扣肩驼背，使得肩颈上斜方肌和胸肌紧张，深层颈部肌肉和上背下斜方肌无力。课程针对胸腔前侧肌肉和颈部前侧的伸展与上背部和颈部后侧肌肉的力量稳定，达到身体姿态的正位。",
    "suitablePeople": "有无瑜伽经验的用户都可以参与。"
