    "classIntroduce": "万圣节狂欢之夜，超级猩猩邀你来“捣蛋”！预约「万圣嘉年华」主题课程，现场可免费领取万圣节变装小礼品。欢迎大家发挥创意根据万圣节主题装扮自己，尽情“变装”， show出灵魂中的自己！这一个晚上，让我们一起狂欢吧！",
    "video": "",
    "trainingEffect": "BODYCOMBAT是快节奏、中高强度、多重复次数的搏击主题有氧运动项目，高效训练四肢肌群和核心。不仅可以燃烧多达740千卡的热量还能让你尽情释放压力。",
    "suitablePeople": "BODYCOMBAT将搏击和有氧训练结合，动作和音乐经过顶级教练员、运动生理专家、编辑师精心研究，不仅安全有效，还易于掌握。无论是平时缺乏锻炼、身材娇小、体质瘦弱的白领女性，还是身体强壮的男性，都非常适合参与，通过课程达到燃脂瘦身，放松减压的目的。"
